import { Injectable } from '@angular/core';
import { Store } from '@ngrx/store';
import { DatePipe } from '@angular/common';

import * as pdfFonts from 'pdfmake/build/vfs_fonts';
import * as pdfMake from 'pdfmake/build/pdfmake';

import * as fromRoot from '../../shared/reducers';
import { TrackerCertificate } from './../models';

@Injectable({
  providedIn: 'root'
})
export class TrackerCertificateService {
  private certificate: TrackerCertificate = new TrackerCertificate({});
  public certificateDoc: any;

  constructor(
    private _store: Store<fromRoot.State>,
    private _datePipe: DatePipe
  ) {
    pdfMake.vfs = pdfFonts.pdfMake.vfs;
    this._store.select(fromRoot.getCurrentTrackerCertificate).subscribe(certificate => this.certificate = certificate);
  }

  createCertificate(certificate: TrackerCertificate): any {
    const general = {
      pageSize: 'A4',
      watermark: {
        text: 'TEDI',
        color: 'grey',
        opacity: 0.2,
        fontSize: 20
      },
      content: [
        this.generateGeneralContent(certificate, 'The Regional Transport Office'),
        this.generateGeneralContent(certificate, 'Customer')
      ],
      styles: {
        header: {
          fontSize: 12,
          bold: true,
          alignment: 'center'
        },
        medium: {
          fontSize: 9
        },
        small: {
          fontSize: 8
        }
      }
    };
    this.certificateDoc = general;
    this.certificateDoc['defaultStyle'] = {
      font: 'NotoSans',
      fontSize: 10
    };
  }

  generateGeneralContent(certificate: TrackerCertificate, type: string): any[] {
    return [
      {
        "columns": [{
          "image": "data:image/jpeg;base64,",
          "width": 80
        },
        {
          "text": "TEDI INDIA Pvt. Ltd.\nOnlineVehicle Tracking Device Certificate\nAIS-140 & AIS004(part-3)\nCertificate No: T1E2D3I0219000017572019",
          "style": "header"
        },
        {
          "image": "data:image/png;base64,",
          "width": 100
        }
        ]
      },
      {
        "text": [{
          "text": "To:",
          "bold": true
        },
        `${type}`
        ],
        "margin": [0, 0, 0, 10]
      },
      {
        "columns": [{
          "table": {
            "body": [
              [{
                text: 'Vehicle details',
                colSpan: 2,
                bold: true
              }, {}],
              [{
                text: [{
                  text: 'Registration number:',
                  style: 'medium'
                }, {
                  "text": certificate.car_reg_number ? certificate.car_reg_number : 'NEW', bold: true,
                  style: 'medium'
                }]
              }, {
                text: [
                  {
                    text: 'Registration month & year: ',
                    style: 'medium'
                  },
                  {
                    text: this._datePipe.transform(certificate.reg_month_year, 'yyyy-MM-dd'),
                    style: 'medium',
                    bold: true
                  }
                ]
              }],
              [{
                text: ['Chassis number:', { "text": certificate.chassis_number, bold: true }]
              }, {
                text: ['Engine number:', { "text": certificate.engine_number, bold: true }]
              }],
              [{
                text: ['Vehicle Make:', { "text": certificate.make, bold: true }]
              }, {
                text: ['Vehicle Model:', { "text": certificate.model, bold: true }]
              }],
            ],
            widths: "*"
          },
          margin: [0, 0, 5, 0]
        },
        {
          "qr": 'TEDI INDIA PVT. LTD.\nSERIAL NO: ' + certificate.device.serial_no + '\nCERTIFICATE NUMBER: '
            + certificate.certificate_number + '\nDATE GENERATED: ' + this._datePipe.transform(certificate.date_generated, 'yyyy-MM-dd')
            + '\nDUE DATE: ' + this._datePipe.transform(certificate.due_date, 'yyyy-MM-dd') + '\nCHASSIS NUMBER: '
            + certificate.chassis_number + '\nENGINE NUMBER: ' + certificate.engine_number + '\nCUSTOMER NAME: '
            + certificate.tracker_customer.name + '\nCAR REG NUMBER: ' + certificate.car_reg_number,
          "fit": 120,
          "width": 120
        }
        ],
        margin: [0, 0, 0, 5]
      },
      {
        "columns": [{
          "table": {
            "body": [
              [{
                text: "Vehicle Owner Details",
                bold: true
              }, {
                text: 'Vahan Details',
                bold: true
              }],
              [{
                text: ['Owner address:\n', { "text": certificate.tracker_customer.name, bold: true }]
              }, {
                text: ['VLTD Serial No:', { "text": certificate.device.serial_no, bold: true }]
              }],
              [{
                text: ['Phone:', { "text": certificate.tracker_customer.phone, bold: true }]
              }, {
                text: ['Fitment centre code:', { "text": "9", bold: true }]
              }],
              [{
                text: ['Email ID:', { "text": certificate.tracker_customer.email, bold: true }]
              }, {
                text: ['Fitment centre name:', { "text": "TEDI INDIA PVT LTD | T1E2", bold: true }]
              }],
              [{
                text: `Device Manufacture Month/Year: ${this._datePipe.transform(certificate.device.created_at, 'yyyy-MM-dd')}`,
                bold: true
              }, {}],
            ],
            "widths": "*"
          },
          margin: [0, 0, 0, 5]
        }
        ]
      },
      {
        "columns": [{
          "table": {
            "body": [
              [{
                text: 'VLTD Details',
                colSpan: 2,
                bold: true
              }, {}],
              [{
                text: ['VLTD Serial No:', { "text": certificate.device.serial_no, bold: true }]
              }, {
                text: ['Software Version:', { "text": "1.5.0(Device)/5.4(System)", bold: true }]
              }],
              [{
                text: ['VLTD Model No:', { "text": "ITS-IRNSS - 01 / SOS - 01", bold: true }]
              }, {
                text: ['ICCID Number:', { "text": "8991800099110760697", bold: true }]
              }],
              [{
                text: ['TAC No:', { "text": "CK8084", bold: true }]
              }, {
                text: ['Device Activation/Certification Date:', { "text": this._datePipe.transform(certificate.date_generated, 'yyyy-MM-dd'), bold: true }]
              }],
              [{
                text: ['COP Validity:', { "text": "30-09-2020", bold: true }]
              }, {
                text: ['Certificate Issued date:', { "text": this._datePipe.transform(certificate.date_generated, 'yyyy-MM-dd'), bold: true }]
              }],
              [{
                text: ['IMEI Number:', { "text": certificate.device.imei, bold: true }]
              }, {
                text: ['Certificate Valid upto:', { "text": this._datePipe.transform(certificate.due_date, 'yyyy-MM-dd'), bold: true }]
              }],
              [{
                text: ['VLTD Test Report:', { "text": "GPS CTOGN0153 / IRNSS CTOM00363", bold: true }]
              }, {
                text: ['Certified by:', { "text": "International Centre For Automative Technology(ICAT)", bold: true }]
              }],
              [{
                text: ['SIM provider 1:', { "text": certificate.device.esim1, bold: true }]
              }, {
                text: ['SIM provider 2:', { "text": certificate.device.esim2, bold: true }]
              }]
            ],
            widths: "*"
          },
          margin: [0, 0, 0, 5]
        }
        ]
      },
      {
        "columns": [{
          "table": {
            "body": [
              [{
                text: `Installed By:\n${certificate.user.name}\n${certificate.user.address ? certificate.user.address : '-'}`, bold: true
              }, {
                text: 'Certificate Issued By: TEDI INDIA PVT LTD', bold: true
              }],
              [{
                text: 'Mandated by-MORTH-Ministry of Road TransPort & Highways',
                bold: true,
                colSpan: 2,
                style: "medium"
              }, {
              }],
              [{
                text: 'This is certifying that following vehicle has been fitted and activated with approved TEDI INDIA Vehicle Location Tracking Device as per AIS-140 &AIS-004 (Part-3) Standard which is activated live tracking and more features, unless the device tampered or the seal is Broken by unauthorized technicians or individual.',
                bold: true,
                style: "small"
              }, {
                text: "RTA/RTO/STA Signature",
                bold: true
              }],
              [{
                text: 'This is to Acknowledge and confirm that we have got our vehicle fitted with above vehicle location tracking unit. We have checked the performance of the vehicle after fitment and we confirm VLD is functioning as per norms laid out in AIS-140 &AIS-004(PART-3), We are satisfied with the performance of the device in all respect we undertake not to raise any dispute or any legal claims against M/S TEDI INDIA PRIVATE LIMITED, In the event that the above mentioned function are found broken/torn/tampered/after expiry & Warranty date issues.',
                bold: true,
                colSpan: 2,
                style: "small"
              }, {}],
              [{
                text: 'Customer Signature:',
                bold: true,
                alignment: "right"
              }, {
                text: "Dealer Signature",
                bold: true,
                alignment: "right"
              }]
            ],
            "widths": "*"
          },
          margin: [0, 0, 0, 5]
        }
        ]
      },
      {
        text: "For Repairs and breakdowns please contact the respective District Dealers,if not attended within 2 working days please inform us in writing E-Mail:info@tediindia.com\nToll Free No. 18001215800\nThis certificate is computer generated and does not require any Seal/Signature in original.",
        style: "small",
        pageBreak: type == 'Customer' ? null : 'after'
      }
    ];
  }

  certificateActions(type: boolean) {
    pdfMake.fonts = {
      NotoSans: {
        normal: 'NotoSans-Regular.ttf',
        bold: 'NotoSans-Bold.ttf',
        italics: 'NotoSans-Regular.ttf',
        bolditalics: 'NotoSans-Regular.ttf'
      }
    };
    this.createCertificate(this.certificate);
    type ? pdfMake.createPdf(this.certificateDoc).download(this.certificate.certificate_number + '.pdf')
      : pdfMake.createPdf(this.certificateDoc).print();
  }
}
